export const ADD_LIST= "ADD_LIST";

export const addlisthandler = (addDataForm) => (dispatch) => {
  dispatch({
    type: ADD_LIST,
    payload:addDataForm,
  });
  toast.success("Successfully Logo Uploaded & Redirect to Color Selection page", {position: toast.POSITION.BOTTOM_CENTER})

};
